import React, { Component, useState } from 'react'
import { Table } from 'react-bootstrap'

export class Patients extends Component {
    constructor (props) {
        super(props)
        this.state = {
            columns: [
                'First Name',
                'Last Name',
                'NPI #',
                'Phone Number',
                'Business Address'
            ],
            users: [
                {
                    FirstName: 'John',
                    LastName: 'Doe',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                },
                {
                    FirstName: 'Jamie',
                    LastName: 'Friend',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                }
            ]
        }

    }

    headers() {
        return this.state.columns.map(col => {
            <th>{ col }</th>
        });
    }

    rows() {
        return this.state.users.map( user => {
            <tr>
                <td>{ user.FirstName }</td>
                <td>{ user.LastName }</td>
                <td>{ user.NPI }</td>
                <td>{ user.PhoneNumber }</td>
                <td>{ user.Address }</td>
            </tr>
        });
    }

    render() {
        return (
        <Table striped bordered hover size='sm'>
            <thead>
                <tr>{ this.headers() }</tr>
            </thead>
            <tbody>
                { this.rows() }
            </tbody>
        </Table>
        )
  }
}

export default Patients
